import './custom-button.styles.scss';

const CustomButton = ({ children, isGoogleSignIn,...otherPorps }) => {   let button;
    if( isGoogleSignIn){
        button = <div></div>
    }else {
        button = <button {...otherPorps} className= 'btn custom-button'>
                    {children}
                </button>
    }
} 


export default CustomButton
